import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import './App.css';  // Import App styles if needed

const App = () => {
  return (
    <div className="App">
      <Header />
      <main>
        {/* Main content of the app */}
        <div>Header is working!</div> {/* Debug line */}
      </main>
      <Footer />
    </div>
  );
};

export default App;
